import React, { useState, useEffect } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css'; // Import Bootstrap CSS
import SideNavbar from "../../components/Doctor/sidenavbar";
import Navbar from "../../components/Doctor/Navbar";
import "../../css/Doctor/ddashboard.css";

export default function UploadSchedule() {
  // Define dummy schedule data
  const dummySchedule = {
    "slots": [
      [2024, 4, 5, 11, 15],
      [2024, 4, 6, 15, 45],
      [2024, 4, 7, 15, 0],
      [2024, 4, 6, 15, 45],
      [2024, 4, 5, 15, 0]
    ],
    "appointments": [
      { id: 1, date: '2024-04-05', time: '09:00', patientName: 'John Doe' },
      { id: 2, date: '2024-04-06', time: '10:30', patientName: 'somebody someone' },
      { id: 3, date: '2024-04-07', time: '11:15', patientName: 'Alice Smith' },
      { id: 5, date: '2024-04-06', time: '09:00', patientName: 'John Doe' },
    ]
  };

  // State for schedule data
  const [schedule, setSchedule] = useState(dummySchedule);

  // State for editing mode
  const [isEditing, setIsEditing] = useState(false);

  // Function to toggle editing mode
  const handleEdit = () => {
    setIsEditing(!isEditing);
  };

  // Function to handle cell click (toggle availability)
  const handleCellClick = (date, time) => {
    // Logic to handle cell click can be added here
  };

  // Function to generate schedule rows
  const generateScheduleRows = () => {
    if (!schedule.slots || !schedule.appointments) return null;

    const timeSlots = ['09:00', '09:45', '10:30', '11:15', '12:00', '12:45', '01:30', '02:15', '03:00', '03:45'];
    const scheduleRows = [];

    // Loop through each slot
    schedule.slots.forEach(slot => {
      const [year, month, day] = slot;
      const formattedDate = `${year}-${month}-${day}`;
      const appointmentsOnDate = schedule.appointments.filter(appointment => appointment.date === formattedDate);

      const slots = timeSlots.map((time, index) => {
        const isBooked = appointmentsOnDate.some(appointment => appointment.time === time);
        const isAvailable = !isBooked;
        const colorClass = isAvailable ? 'table-success bg-success text-white' : 'table-danger bg-danger text-dark';

        return (
          <td
            key={`${formattedDate}-${index}`}
            className={colorClass}
            onClick={() => handleCellClick(formattedDate, time)}
          >
            {time}
          </td>
        );
      });

      scheduleRows.push(
        <tr key={formattedDate}>
          <th scope="row">{formattedDate}</th>
          {slots}
        </tr>
      );
    });

    return scheduleRows;
  };

  return (
    <div className='dashboard-container'>
      <Navbar />
      <div className='dashboard-content'>
        <SideNavbar />
        <div className="main-content">
          <h2>This week's Schedule</h2>
          <table className="table table-bordered custom-box khus">
            <thead>
              <tr>
                <th></th>
                <th>9:00 AM</th>
                <th>9:45 AM</th>
                <th>10:30 AM</th>
                <th>11:15 AM</th>
                <th>12:00 PM</th>
                <th>12:45 PM</th>
                <th>01:30 PM</th>
                <th>02:15 PM</th>
                <th>03:00 PM</th>
                <th>03:45 PM</th>
              </tr>
            </thead>
            <tbody>
              {generateScheduleRows()}
            </tbody>
          </table>

          <button type="button" className="btn btn-primary custom-button" onClick={handleEdit}>
            {isEditing ? 'Cancel Edit' : 'Edit Schedule'}
          </button>
          {isEditing && (
            <button type="button" className="btn btn-primary custom-button" onClick={handleSubmit}>
              Submit
            </button>
          )}
        </div>
      </div>
    </div>
  );
}
